    <>
    <Row>{
      allVideo.length > 0 ?
      allVideo.map((videos)=>(
        <Col sm={12} md={6} lg={4} xl={3}>
<VideoCard/>
    </Col>

      ))
       :
        <p>nothing to display</p>
    }  
        
    </Row>
    </>
  )
}

